import React,{Component} from 'react';
import { Platform, StyleSheet, Text, View, TouchableOpacity } from 'react-native';

export default class App extends Component{
  render(){
  return (
    <View style={styles.body}>

      <View  style={styles.tContainer}>
        <Text  style={styles.counterText}>0.0</Text>

        <View style={styles.containerBotao}>
          <TouchableOpacity style={styles.botao}>
            <Text style={styles.botaoText}>Start</Text>
          </TouchableOpacity>

          <TouchableOpacity style={styles.botao}>
            <Text style={styles.botaoText}>Pause</Text>
          </TouchableOpacity>
        </View>

      </View>

      <View style={styles.footer}>
        <Text style={styles.footerText}>@angelina</Text>
      </View>
    </View>
  );
  }
}

const styles = StyleSheet.create({
  body: {
    flex: 1,
    backgroundColor: '#221D41',
    justifyContent: 'center',
  },

  footer:{
    position:'absolute',
    bottom:0,
    backgroundColor:'#000',
    opacity:0.4,
    justifyContent:"flex-end",
    alignItems:'center',
    width:'100%',
    height:20,
  },

  footerText:{
    color:'#fff'
  },

  tContainer:{
    justifyContent: 'center',
    alignItems:'center'
  },

  counterText:{
    color:'#fff',
    fontSize:40,
    fontWeight:'bold',
  },

  containerBotao:{
    flexDirection:'row',
    padding:20,
  },

  botao:{
    backgroundColor:'#331DF4',
    marginHorizontal: 15,
    borderRadius:10,
    height:40,
    width:70,
    justifyContent:'center',
    alignItems:'center',
  },

  botaoText:{
    color:'#fff',
    fontWeight:'bold',


  }

});

